style.css:
@-moz-document domain(wikipedia.org) {
body {
    filter: invert(100%);
    background-color:#000;
}
img {
    filter: invert(100%);
}
p, i {
	color:#e300ff;
}
a, a:visited, .selected {
	color:#003cff;
}
th, .citation {
	color:#ff8000;
}
td {
	color:#0f7;
}
h1, h2, h3, h4 ,h5, .reference-text {
	color:#7f0;
}
}
